/* Model creation/destruction functions */

void MODEL_mkAmpelTest::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkAmpelTest_instance = new MOD_mkAmpelTest(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkAmpelTest_instance->INST_ampel_state.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_pedestrian_state.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_pedestrian_request.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_start_wire.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_start_reg_2.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_abort.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_state_set_pw.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_state_overlap_pw.set_clk_0)("CLK");
  (mkAmpelTest_instance->INST_ampel_testFSM_state_fired_1.set_clk_0)("CLK");
  (mkAmpelTest_instance->set_clk_0)("CLK");
}
void MODEL_mkAmpelTest::destroy_model()
{
  delete mkAmpelTest_instance;
  mkAmpelTest_instance = NULL;
}
