/* VCD dumping functions */
MOD_mkAmpelTest & mkAmpelTest_backing(tSimStateHdl simHdl)
{
  static MOD_mkAmpelTest *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkAmpelTest(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
